import React, { useState } from "react";
import { Countries } from "../../typings/countries";
import axios from "axios";
import { createTicketUrl } from "../../api/Api";
import {
	TextField,
	Box,
	Button,
	Select,
	MenuItem,
	Typography,
	FormControl,
	InputLabel,
	FormLabel,
} from "@mui/material";
import Styles from "../ticket/styles/createTicket.module.css";
import { LoginStyles } from "../auth/styles/Styling.jsx";
const CreateTicktet = () => {
	const initialValue = {
		depatureDate: "",
		returnDate: "",
		description: "",
		from: "",
		destination: "",
	};

	const [data, setData] = useState(initialValue);

	const handleChange = (e) => {
		setData((prevState) => ({
			...prevState,
			[e.target.name]: e.target.value,
		}));
	};

	const handleSubmit = async (e) => {
		e.preventDefault();
		console.log("data --> ", data);

		const formData = {
			...data,
			date: data.date.toString(),
			time: data.time.toString(),
		};
		await axios
			.post(createTicketUrl("64c7d332088415f5394d4f82"), formData)
			.then((response) => {
				console.log("Ticket response --> ", response.data);
			})
			.catch((error) => console.log("Ticket error --> ", error));
		// console.log('Ticket res 2 --> ', response.data)
		// if(response.status === 200){
		//     console.log('Ticket res 2 --> ', response.data)
		// }
	};

	return (
		<Box
			sx={LoginStyles.LoginMainStyles}
			className={Styles.ticketMainContain}
		>
			<Typography sx={LoginStyles.WelcText}>CreateTicktet</Typography>

			<Box
				sx={{ "& fieldset": { border: "none" } }}
				component="form"
				className={Styles.ticketForm}
				onSubmit={handleSubmit}
			>
				<Box
					className={Styles.ticketFormControl}
					id={Styles.ticketTextField}
				>
					<FormControl
						sx={{ hover: "unset", outline: "unset" }}
						className={Styles.ticketTextField}
					>
						<InputLabel>From</InputLabel>
						<Select
							name="from"
							id="from"
							value={data.from}
							onChange={handleChange}
							className={Styles.ticketTextField}
						>
							<MenuItem value="">Select Countries</MenuItem>
							{Countries.map((values, index) => (
								<MenuItem key={index} value={values}>
									{values}
								</MenuItem>
							))}
						</Select>
					</FormControl>
					<FormLabel sx={{ textAlign: "start", fontWeight: "700" }}>
						Depature date
					</FormLabel>
					<Box className={Styles.ticketTextField}>
						<TextField
							sx={{ "& fieldset": { border: "none" } }}
							type="date"
							name="depatureDate"
							format="MM/dd/yyyy"
							value={data.depatureDate.slice(0, 10)}
							onChange={handleChange}
							className={Styles.ticketTextField}
						/>
					</Box>
					<FormLabel sx={{ textAlign: "start", fontWeight: "700" }}>
						Return date
					</FormLabel>
					<Box className={Styles.ticketTextField}>
						<TextField
							sx={{ "& fieldset": { border: "none" } }}
							type="date"
							name="returnDate"
							format="MM/dd/yyyy"
							value={data.returnDate.slice(0, 10)}
							onChange={handleChange}
							className={Styles.ticketTextField}
						/>
					</Box>
				</Box>
				<Box
					className={Styles.ticketFormControl}
					id={Styles.ticketFormControl}
				>
					<FormControl  className = {Styles.ticketTextField}sx={{ textAlign: "start", fontWeight: "700" }}>
						Return date
						<InputLabel>Destination</InputLabel>
						<Select
							name="destination"
							id="destination"
							value={data.destination}
							onChange={handleChange}
							className={Styles.ticketTextField}
						>
							<MenuItem value="">Select Countries</MenuItem>
							{Countries.map((values, index) => (
								<MenuItem key={index} value={values}>
									{values}
								</MenuItem>
							))}
						</Select>
					</FormControl>
                    <FormLabel sx={{ textAlign: "start", fontWeight: "700" }}>
						Return date
					</FormLabel>
					<TextField
						fullWidth
						multiline
						name="description"
						id=""
						minRows={5}
						maxRows={5}
						value={data.description}
						onChange={handleChange}
						className={Styles.ticketTextField}
						sx={{ "& fieldset": { border: "none" } }}
					/>
				</Box>
			</Box>
			<Box className={Styles.ticketBtn}>
				<Button
					sx={LoginStyles.ButtonStyles}
					className={Styles.ticketTextField}
					id={Styles.ticketBtn}
					type="submit"
				>
					Submit
				</Button>
			</Box>
		</Box>
	);
};

export default CreateTicktet;
